import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {
    return (<ul>
        <li>Learn react</li>
        <li>Learn docker</li>
        <li>Learn AWS</li>
    </ul>);
};

const AppHeader = () => {
    return <h1>My todo list</h1>;
};

const SearchPanel = () => {
    const searchplaceholder = "search";
    const searchStyle = {
        fontSize: '25px'
    };
    return <input placeholder={searchplaceholder} style={searchStyle}/>;
};

const TodoListApp = () => {
    return (
        <div>
            <AppHeader/>
            <SearchPanel/>
            <TodoList items={["item1", "item2"]}/>
        </div>);
};

ReactDOM.render(<TodoListApp/>, document.getElementById('root'));
